  true,\n\t\"url\": null,\n\t\"notes\": \"Due to the United States' high rates of
  obesity and diet-related chronic diseases, this project aims to develop a plan for
  front of package (FOP) and shelf-labeling systems that identifies healthy choices,
  develops theory-based approaches that leverage FOP and shelf-labeling systems to
  promote healthier food purchases by SNAP participants, and identifies further exploration
  through the implementation and testing of a future pilot study.\",\n\t\"license_title\":
